import { ReactNode } from 'react';
import {
  Box,
  Flex,
  Heading,
  Text,
  Stack,
  Container,
  Avatar,
  useColorModeValue,
  Image
} from '@chakra-ui/react';



export default function Description_3() {
  return (
    <Box bg="white">
      <Container maxW={'7xl'} py={16} as={Stack} spacing={12}>
        <Stack
          direction={{ base: 'column', md: 'row' }}
          spacing={{ base: 10, md: 6, lg: 10 }}>

            <Stack 
            spacing={0} 
            align={'center'}
            pt={0}
            padding={70}
            mt={100}>
            <Heading>
              Great Support
            </Heading>
              <Text
              fontSize={40}
              align={'center'}
              color='#175E7D'
              >
                We actively help clients think through their inventory management processes, 
                help them configure their inventory, and even organize and upload their data. And If
                you call or email about an issue, you will connect with a real person right away.
              </Text>
            </Stack>
            <Stack
            spacing={0} 
            align={'center'}
            >
            <Image
            w={600}
            h={400}
                    rounded={'md'}
                    alt={'feature image'}
                    src={
                      'images/graph_paper.png'
                    }
                    objectFit={'cover'}
                    
                  />
            </Stack>
        </Stack>
      </Container>
    </Box>
  );
}
